// src/components/Skills.js
import React from 'react';
import '../styles/Skills.css'

const Skills = () => {
  return (
    <section id="skills" className="skills-section">
    <div className="skills-section">
      <h2>Skills</h2>
      <ul>
        <li><div>
        <img src='https://tse3.mm.bing.net/th?id=OIP.TrNwUpl6jCYEcKXm-f-b5gHaHa&pid=Api&P=0&h=180'/>
          <h5>HTML</h5>
        </div></li>
        <li>CSS</li>
        <li>BootStrap</li>
        <li>Flexbox</li>
        <li>Python</li>
        <li>Javascript</li>
        <li>SQL</li>
        <li>Node.js</li>
        <li>React.js</li>
      </ul>
      </div>
    </section>
  );
};

export default Skills;
